import React from 'react';
import Footer from './Footer';
import Header from './Header';
import CallToAction from './Hire';

const Contact = () => {
  return (
    <div>
      <Header />
      <h1>Contact Me</h1>
      <p>You can reach me through the following:</p>
      <ul>
        <li>Email: [Insert your email address]</li>
        <li>Phone: [Insert your phone number]</li>
        <li>Social Media: [Insert links to your social media profiles]</li>
      </ul>
      <Footer />
      <CallToAction />
    </div>
  );
}

export default Contact;
